/*Table structure for table `usuarios` */

DROP TABLE IF EXISTS `usuarios`;

CREATE TABLE `usuarios` (
  `id` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `nombre` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `app_paterno` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `app_materno` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `sexo` varchar(20) COLLATE utf8_spanish_ci DEFAULT NULL,
  `edad` int(20) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `foto` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `tel_oficina` varchar(20) COLLATE utf8_spanish_ci DEFAULT NULL,
  `extension` varchar(20) COLLATE utf8_spanish_ci DEFAULT NULL,
  `tel_mobil` varchar(20) COLLATE utf8_spanish_ci DEFAULT NULL,
  `organismos` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `unidad_responsable` varchar(3) COLLATE utf8_spanish_ci DEFAULT NULL,
  `credenciales` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `pregunta` varchar(200) COLLATE utf8_spanish_ci DEFAULT NULL,
  `respuesta` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `password` varchar(20) COLLATE utf8_spanish_ci DEFAULT NULL,
  `cargo` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

